body:
I ran into this error as well when building StarkNet Juno on Windows. A probable reason is that `mdbx_module_handler` and thus `mdbx_winnt_import()` is never called, leading to `mdbx_srwlock_Init == 0` (never initialized) in `__cold int mdbx_env_create(MDBX_env **penv)`. I verified this with the following changes:
// mdbx.c line 14834 at commit https://github.com/torquem-ch/mdbx-go/commit/c6db395a5b8f5e2c5b346231239515ba0049ef5e
```c
#if defined(_WIN32) || defined(_WIN64)
  const HINSTANCE hKernel32dll = GetModuleHandleA("kernel32.dll");
  printf("%d\n", mdbx_srwlock_Init);  //0
  printf("%d\n", mdbx_srwlock_Init = (MDBX_srwlock_function)GetProcAddress(hKernel32dll, "InitializeSRWLock"));  // some valid address
  printf("%d\n", mdbx_srwlock_Init);  // some valid address
  mdbx_srwlock_Init(&env->me_remap_guard);  // executed correctly
  InitializeCriticalSection(&env->me_windowsbug_lock);
#else
  rc = mdbx_fastmutex_init(&env->me_remap_guard);
  if (unlikely(rc != MDBX_SUCCESS)) {
    mdbx_fastmutex_destroy(&env->me_dbi_lock);
    goto bailout;
  }
```
To solve the problem, flags should be set to call `mdbx_module_handler`, though I am not quite sure how to set flags correctly for now.
